// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

/**
 * @title For ERC721 Library
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-8-14 | VERSION: v1.0.2
 */

library NftLibrary {
    using EnumerableSet for EnumerableSet.UintSet;

    uint8 constant private BIT_QUALITY   = 24; // uint 8
    uint8 constant private BIT_HEROID    = 16; // uint 8
    uint8 constant private BIT_TQUALITY  = 88; // uint 8
    uint8 constant private BIT_THEROID   = 80; // uint 8
    uint8 constant private BIT_POWER     = 80; // uint 8
    uint8 constant private BIT_CARDRATE  = 64; // uint 32
    uint8 constant private BIT_AMOUNT    = 32; // uint 32

    function cLeft(
        uint8 quality_, uint8 heroId_, uint16 index_
    ) public pure returns (uint40 card) {

        card = 1 << 39 |
        uint40(uint8(quality_)) << BIT_QUALITY |
        uint40(uint8(heroId_))  << BIT_HEROID |
        uint40(uint16(index_))  << 0;
    }

    function cRight(uint256 card) public pure returns
        (uint8 quality, uint8 heroId) {

        quality = uint8(uint40(card) >> BIT_QUALITY);
        heroId  = uint8(uint40(card) >> BIT_HEROID);
    }

    function tLeft(DetailStruct memory cs_) public
        view returns (uint104 tokenId) {

        tokenId = 1 << 103 |
        uint104(uint8(cs_.quality))  << BIT_TQUALITY |
        uint104(uint8(cs_.heroId))   << BIT_THEROID |
        uint104(uint8(cs_.quality))  << BIT_POWER |
        uint104(uint16(cs_.rate))    << BIT_CARDRATE |
        uint104(uint32(cs_.amount))  << BIT_AMOUNT |
        uint104(uint32(block.timestamp)) << 0;
    }

    function tRight(uint104 tokenId_) public pure
        returns (DetailStruct memory cs) {

        cs.quality = uint8(tokenId_  >> BIT_TQUALITY);
        cs.heroId  = uint8(tokenId_  >> BIT_THEROID);
        cs.rate    = uint16(tokenId_ >> BIT_CARDRATE);
        cs.amount  = uint32(tokenId_ >> BIT_AMOUNT);
    }

    struct UserStruct { uint256 powers; uint256 period; uint256 exchange; }

    struct RecordStruct { uint256 powers; uint256 reward; uint104[] specials; }

    struct DetailStruct { uint8 quality; uint16 heroId; uint16 rate; uint256 amount; }
}

